    }
    function onChange12(ev) {
        const {name, value} = ev.target;
        setDatafinal(value); console.log(value);
    }
    function onChange13(ev) {
        const {name, value} = ev.target;
        setDatafinal(value); console.log(value);
    }
    function onChange14(ev) {
