            setTabela9(response.data)
           
          
        })
    },[datainicial,datafinal, combocodigosele8]);

    {/*Troca */}
    {/* Tabela todos os códigos */}
    const tabelamovimentacao10 = useCallback(() => {
        api.get(`totitemtrdcdt/${datainicial}/${datafinal}/${combocodigosele9}/`).then(response => {
