    },[datainicial,datafinal, combocodigosele9]);

    {/* Tabela por código */}
    const tabelamovimentacao11 = useCallback(() => {
        api.get(`totitemtrcod/${datainicial}/${datafinal}/${combocodigosele10}/`).then(response => {
