    },[datainicial,datafinal, combocodigosele10]);
 
    {/* Tabela por documento itens  */}
    const tabelamovimentacao12 = useCallback(() => {
        api.get(`totitemtrdoc/${datainicial}/${datafinal}/${combocodigosele11}/`).then(response => {
